import './main.css';
import './result.css';
import React, { useEffect, useState } from "react";
function Home() {
   const [keyword, setKeyword] = useState("");
   useEffect(() => {
        const storedKeyword = localStorage.getItem("selectedKeyword");
       if (storedKeyword) {
         setKeyword(storedKeyword);
       }
      }, []);
  return (
    <div>
       <h1 class="top-heading"> <img
                  src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
                  width="50"
                  height="55"
                  alt="MoodMelody Logo"
                /> MoodMelody </h1>
      <p className="top-Description">Your Personalized music and story are ready</p>
    
    <div class="container" id="mini-cont">
  <div class="row">
    <div class="col-4"><h3 class="detections">Detected Expression</h3></div>
    <div class="col-4"><h3 class="detections">Keyword</h3></div>
    <div class="col-4"><h3 class="detections">confidence</h3></div>
  </div>
  <div class="row">
    <div class="col-4">col-8</div>
    <div class="col-4"><h5 class="detected">{keyword || "—"}</h5></div>
    <div class="col-4">col</div>
  </div>
</div>
 <div class="container" id="main-cont">
 <div class="row">
    <div class="col-sm-5" id="music-sug"><h3 class="detections"><img
                  src={`${process.env.PUBLIC_URL}/fyp-images/icon.png`}
                  width="30"
                  height="30"
                  alt="MoodMelody Logo"
                  class="logo-icon"
                />Recommended Music</h3></div>
    <div class="col-7" id="story"><h3 class="detections"><img
                  src={`${process.env.PUBLIC_URL}/fyp-images/story.jpg`}
                  width="30"
                  height="30"
                  alt="MoodMelody Logo"
                  class="logo-icon2"
                />Generated Story</h3></div>
  </div>
    </div>
    </div>
  );
}
export default Home;
